## Tooltip

The Tooltip component is a simple component that shows a message when the user hovers over an element.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, message }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      onMouseEnter={() => setTooltip(message)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </div>
  );
};

export default Tooltip;
```

## TooltipContext

The TooltipContext is a React Context that is used to manage the state of the Tooltip component. It is used to store the current tooltip message and to close the tooltip when the user hovers over a different element.

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ setTooltip }}>
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

## Usage

To use the Tooltip component, you need to wrap your application in the TooltipProvider component. This will provide the Tooltip component with the necessary context to manage the state of the tooltip.

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip message="Hello World">
          <button>Hover over me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

## Conclusion

In this post, we have seen how to create a Tooltip component in NextJS using React Context. The Tooltip component is a simple component that shows a message when the user hovers over an element. The TooltipContext is used to manage the state of the Tooltip component and to close the tooltip when the user hovers over a different element. The Tooltip component can be used in different places in your application by wrapping your application in the TooltipProvider component.

